webpackJsonp([68324130903423],{554:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Eh, I Could Eat",author:"Jacob Aronoff"}},markdownRemark:{id:"/Users/jea/Documents/Code/github/icouldeat/src/pages/eisenbergs/index.md absPath of file >>> MarkdownRemark",html:'<h3>Pancakes &#x26; Chocolate Egg Cream</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/picture-27b8a744aca2ca91056a8e675ce08a30-01800.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Pancakes & Chocolate Egg Cream"\n        title=""\n        src="/static/picture-27b8a744aca2ca91056a8e675ce08a30-f8fb9.jpg"\n        srcset="/static/picture-27b8a744aca2ca91056a8e675ce08a30-e8976.jpg 148w,\n/static/picture-27b8a744aca2ca91056a8e675ce08a30-63df2.jpg 295w,\n/static/picture-27b8a744aca2ca91056a8e675ce08a30-f8fb9.jpg 590w,\n/static/picture-27b8a744aca2ca91056a8e675ce08a30-85e3d.jpg 885w,\n/static/picture-27b8a744aca2ca91056a8e675ce08a30-d1924.jpg 1180w,\n/static/picture-27b8a744aca2ca91056a8e675ce08a30-9452e.jpg 1770w,\n/static/picture-27b8a744aca2ca91056a8e675ce08a30-01800.jpg 4032w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Rarely is a meal in NYC cheaper than $6 and absolutely amazing. To me, this is the quintessential New York diner. The food is cheap, but absolutely amazing. It’s a real diner and has everything a diner should have; cheap chairs, cheap food, fast food, and a good staff. I’m going to be bringing all of my friends here for brunches/ breakfasts. I got the pancakes were sooooo fluffy with a side of bacon ($7). The side of bacon wasn’t just like two strips though, it was HUGE lot of it. The egg cream, which has neither egg nor cream, was awesome too. Really loved this meal, can’t wait to go back, deserves the 10/10 rating. Best bang for your buck in the city.</p>\n<p>Rating: 10/10</p>',frontmatter:{title:"Eisenberg's Sandwich Shop",date:"January 25, 2018"}}},pathContext:{slug:"/eisenbergs/",previous:{fields:{slug:"/beauty-and-essex/"},frontmatter:{title:"Beauty and Essex"}},next:{fields:{slug:"/hi-collar/"},frontmatter:{title:"Hi-Collar"}}}}}});
